import React from "react";
import { RepoData } from "../RepoResPage";

type RepoProps = {
  repo: RepoData;
};

const Repo = ({ repo }: RepoProps) => {              {/*CREATING A REPO COMPONENT TO DISPLAY THE REPO DATA*/}
  return (
    <div className="flex flex-col items-start w-full gap-4 px-2 py-4 border-b-2 border-gray-100 md:px-16 h-36"> 
      <h2 className="text-xl font-semibold text-blue-600 underline">{repo.name}</h2>
      <p className="text-base font-normal text-left">{repo.description}</p>
      <div className="flex items-center w-full gap-8">
        <span className="text-sm font-medium">{repo.language}</span>
        <span className="text-sm font-medium">
          Updated on {repo.updated_at.slice(0, 10)}
        </span>
        
      </div>
    </div>
  );
};

export default Repo;
